Ditpolairud Polda DIY bersinergi dengan Polres Bantul dan Stakeholder terkait, laksanakan Pengamanan Jogja International Kite Festival 2025.

Kegiatan ini diikuti oleh beberapa negara dan berlangsung 2 hari yakni pada tanggal 26 dan 27 Juli 2025 di Pantai Parangkusumo Kretek Bantul.

Festival layang-layang berskala Internasional ini menampilkan aneka bentuk budaya dan kompetisi spektakuler dari berbagai penjuru dunia.

pada pengamanan ini kami memastikan keamanan dan kenyamanan pengunjung yang berkunjung dengan memberikan himbauan agar memperhatikan keseleamtan serta mengawasi putra-putrinya agar tidak terpisah dari rombongan.

selain pengamanan dilokasi dari jajaran polres bantul, guna mencegah kemacetan lalu lintas selama festival berlangsung personil melaksanakan pengaturan lalu lintas guna melancarkan arus kendaraan menuju dan keluar dari lokasi festival.

